def get_result_info(results, first_elem='', info=None):
    if info is None:
        info = ['id']
    elements = []
    next_link = ""
    while next_link is not None:
        print("Getting results")
        results = results[first_elem] if first_elem != '' else results
        for item in results['items']:
            tmp_list = [None for _ in range(len(info))]
            for idx, field in enumerate(info):
                tmp_list[idx] = item[field]
            elements.append(tmp_list)
        next_link = results['next']
        results = sp.next(results)
    return elements


def get_album_search(query):
    full_set = set([])
    albums = sp.search(query, type="album", limit=50, offset=0, market='US')
    dict_type = "albums"
    next_link = ""
    while next_link is not None:
        for album in albums[dict_type]['items']:
            full_set.add(album['id'])
            # print(album['id'], album['name'])
        next_link = albums[dict_type]['next']
        albums = sp.next(albums[dict_type])
    return full_set


def chunks(items, size):
    size = max(1, size)
    return (items[i:i+size] for i in range(0, len(items), size))


def get_album_tracks(album_id):
    print("Getting albums")
    return get_result_info(
        sp.album_tracks(album_id
                        , limit=50
                        , market="US")
        , info=['id'])


